import React from "react";
import "./styles/home.css";

export default function ButtonAppBar() {
  return (
    <header>
      <div id="siteTitle">
        <a href="/">Bessie Bauman</a>
      </div>
      <br />
      <nav>
        <a href="/work/">Work Experience</a>
        <a href="/writing/">Writing</a>
        <a href="/contact/">Contact Info</a>
      </nav>
    </header>
  );
}
